import React from 'react';

function Messages({ user }) {
    return (
        <div className="container" style={{ padding: 40, textAlign: 'center' }}>
            <h2>Messages</h2>
            <p>Here you can chat with friends.</p>
        </div>
    );
}

export default Messages;
